import { Button, Rating, TextField, Typography } from '@mui/material'
import React, { useState } from 'react'

const Form = () => {
    const [formData, setFormData] = useState({
        name: '',
        phoneNumber: '',
        rating: 0,
        comments: ''
    });

    const handleChange = (field, value) => {
        setFormData({
            ...formData,
            [field]: value
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log(formData);
    }

    return (
        <div className='form'>
            <Typography component="legend" className='heading'>Sustainable Impact Feedback Form</Typography>
            <TextField
                id="name"
                label="Name"
                variant="outlined"
                onChange={(e) => handleChange('name', e.target.value)}
            />
            <TextField
                id="phoneNumber"
                label="Phone Number"
                variant="outlined"
                onChange={(e) => handleChange('phoneNumber', e.target.value)}
            />

            <Typography component="legend">How do you rate our service:</Typography>
            <Rating
                name="simple-controlled"
                value={formData.rating}
                onChange={(_, newValue) => handleChange('rating', newValue)}
            />

            <TextField
                id="comments"
                label="Comments"
                variant="outlined"
                multiline
                rows={4}
                onChange={(e) => handleChange('comments', e.target.value)}
            />

            <Button variant="contained" onClick={(e) => handleSubmit(e)}>SUBMIT</Button>
        </div>
    );
}

export default Form;
